// Añadir los marcadores al mapa


// Crear variable para la ruta y marcador del usuario
var rutaLayer;
var marcadorSeleccionado;
var circuloPrecision = null;

// Función para crear la ruta desde la ubicación actual hasta el marcador
function trazarRuta(destino) {
    if (rutaLayer) {
        map.removeControl(rutaLayer); // Quitar la ruta anterior si existe
    }

    navigator.geolocation.getCurrentPosition(function(position) {
        var inicio = [position.coords.latitude, position.coords.longitude];
        
        // Crear la ruta en el mapa
        rutaLayer = L.Routing.control({
            waypoints: [
                L.latLng(inicio),
                L.latLng(destino.latitud, destino.longitud)
            ],
            createMarker: function() { return null; },
            lineOptions: { styles: [{ color: 'blue', opacity: 0.6, weight: 4 }] }
        }).addTo(map);
    });
}


// Mostrar la ubicación del usuario en tiempo real con un círculo de precisión
function actualizarUbicacionUsuario() {
    navigator.geolocation.watchPosition(function(position) {
        var lat = position.coords.latitude;
        var lon = position.coords.longitude;
        var precision = position.coords.accuracy; // Obtener la precisión en metros

        // Si es la primera vez, crear el círculo
        if (!circuloPrecision) {
            circuloPrecision = L.circle([lat, lon], {
                radius: precision,
                color: 'blue',
                fillColor: '#1E90FF',
                fillOpacity: 0.3
            }).addTo(map);
        } else {
            // Actualizar la posición y radio del círculo de precisión
            circuloPrecision.setLatLng([lat, lon]);
            circuloPrecision.setRadius(precision);
        }

        if (marcadorSeleccionado) {
            trazarRuta(marcadorSeleccionado);
        }
    }, function(error) {
        console.error("Error obteniendo la ubicación: ", error);
    }, {
        enableHighAccuracy: true
    });
}




