 function buscarComercio() {
    var codigo = document.getElementById('codigoComercio').value; // Obtener el código ingresado
    var encontrado = false;

    marcadores.forEach(function (marcador) {
        if (marcador.CodigoUnicoComercio === codigo) { // Compara con CodigoUnicoComercio
            encontrado = true;
            marcadorSeleccionado = marcador;

            // Centrar el mapa en el marcador encontrado
            map.setView([marcador.latitud, marcador.longitud], 14);

            // Abrir el popup del marcador
            L.popup()
                .setLatLng([marcador.latitud, marcador.longitud])
                .setContent(`
                    <h3>${marcador.NomCorresponsal}</h3>
                    <p>DIRRECCIÓN: ${marcador.DIreccion}</p>
                    <p>BARRIO: ${marcador.Barrio}</p>
                    <p>Tipo de negocio: ${marcador.TipoNegocio}</p>
                    <img src="${marcador.foto_url}" style="max-width: 100%; height: auto;" />
                `)
                .openOn(map);

            // Trazar la ruta desde la ubicación actual hasta el marcador encontrado
            trazarRuta(marcadorSeleccionado);
        }
    });

    if (!encontrado) {
        alert("Comercio no encontrado");
    }
}
